E_D("replace into `phome_ecms_game` values('6414','14','2','','','','1','admin','|6|1|26|','1','0','1343237330','0','0','0','1','','','6414','0','0','0','0','0','0','听妈妈讲那过去的事情','1343237330','/spic/20120725/11568.jpg','0','1','1343605915','0','3','1','0','','1','','/d/file/swf/tingmamajiang.swf','667','479','月亮在白莲花般的云朵里穿行<br />晚风吹来一阵阵快乐的歌声<br />我们坐在高高的谷堆旁边<br />听妈妈讲那过去的事情<br />那时候，妈妈没有土地<br />全部生活都在两只手上<br />汗水流在地主火热的田野里<br />妈妈切却吃着野菜和谷糠<br />冬天的风雪狼一样嚎叫<br />妈妈却穿着破烂的单衣裳<br />她去给地主缝一件狐皮长袍<br />又冷又饿跌倒在雪地上<br />经过了多少苦难的岁月<br />妈妈才盼到今天的好光景','1','','0','','1','/dpic/20120725/11569.jpg','378','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5TY0dKdFpIUlpWekZvWVcxc2FHSnRZM1ZqTTJSdA==','2','0','http://s.61baobao.com/common/flash/2006/tingmamajiang.swf','http://www.61baobao.com/common/flash/2006/dpic/tingmamajiang.jpg','http://www.61baobao.com/common/flash/2006/pic/378.jpg','0','三个月以上','0','','0','','0','0','0');");
