E_D("replace into `phome_ecms_game` values('6419','14','0','','','','1','admin','|1|','1','0','1343237331','0','0','0','0','','','6419','0','0','0','0','0','0','秋天秋天多么美','1343237331','/spic/20120725/11600.jpg','0','1','1343237331','0','3','1','0','','0','','/d/file/swf/qiutian.swf','667','479','秋风秋风轻轻吹，<br />棉桃姐姐咧呀咧开嘴，<br />你看她露出小呀小白牙，<br />张张脸蛋笑微微。<br />来来来来来来来来，<br />秋天多么美，<br />来来来，多呀多么美。<br /><br />秋风秋风轻轻吹，<br />稻花姐姐把呀把手挥，<br />你看她梳着金呀金头发，<br />结出串串金穗穗。<br />来来来来来来来来，<br />秋天多么美，<br />来来来，多呀多么美。<br /><br />秋风秋风轻轻吹，<br />高粱姐姐喜呀喜红了眉，<br />你看她跳起丰呀丰收舞，<br />压得秆头往下垂。<br />来来来来来来来来，<br />秋天多么美，<br />来来来，多呀多么美。<br />','1','','0','','1','/dpic/20120725/11601.jpg','361','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5HY0dSWVVuQlpWelIxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2006/qiutian.swf','http://www.61baobao.com/common/flash/2006/dpic/qiutian.jpg','http://www.61baobao.com/common/flash/2006/pic/361.jpg','0','三个月以上','0','','0','','0','0','0');");
