E_D("replace into `phome_ecms_game` values('6423','14','0','','','','1','admin','|26|','1','0','1343237333','0','0','0','0','','','6423','0','0','0','0','0','0','世上只有妈妈好','1343237333','/spic/20120725/11612.jpg','0','1','1343237333','0','3','1','0','','0','','/d/file/swf/shishangzhiyoumamahao.swf','667','479','    世上只有妈妈好，有妈的孩子像个宝，投进了妈妈的怀抱，幸福享不了。世上只有妈妈好，有妈的孩子像个宝，投进了妈妈的怀抱，幸福享不了。没有妈妈最苦恼，没妈的孩子像根草，离开妈妈的怀抱，幸福哪里找？没有妈妈最苦恼，没妈的孩子像根草，离开妈妈的怀抱，幸福哪里找？<br />   ','1','','0','','1','/dpic/20120725/11613.jpg','357','VEROd01Fd3pSbkJpYlVwb1luazVlbUZIYkhwaFIwWjFXak53YjJGWWJIWmtWekZvWWxkR2IxbFhPSFZqTTJSdA==','0','0','http://s.61baobao.com/zt/qinbao/shishangzhiyoumamahao.swf','http://www.61baobao.com/common/flash/2006/dpic/shishangzhiyoumamahao.jpg','http://www.61baobao.com/common/flash/2006/pic/357.jpg','0','三个月以上','0','','0','','0','0','0');");
