E_D("replace into `phome_ecms_game` values('6425','14','0','','','','1','admin','','1','0','1343237334','0','0','0','0','','','6425','0','0','0','0','0','0','三个和尚','1343237334','/spic/20120725/11640.jpg','0','1','1343237334','0','3','1','0','','0','','/d/file/swf/sange.swf','667','479','一个和尚挑呀么挑水喝<br />嘿嘿 挑呀么挑水喝<br />咿咿 挑呀么挑水喝<br />两个和尚抬呀么抬水喝<br />嘿嘿 抬呀么抬水喝<br />咿咿 抬呀么抬水喝<br />三人和尚没水喝没呀没水喝<br />嘿 没呀没水喝呀<br />咿 没呀没水喝呀<br />你说这是为什么呀为呀为什么<br />嘿嘿 你说这是为什么呀为呀为什么<br />为什么呀和尚越来越多<br />嘿嘿 越来越多<br />咿咿 越来越多<br />为什么呀和尚越来越懒惰<br />嘿嘿 越来越懒惰<br />咿咿 越来越懒惰<br />为什么呀长老呀不来说一说呀<br />嘿 不来说一说呀<br />咿 不来说一说呀<br />睁着眼闭着眼阿弥陀佛<br />嘿嘿 睁着眼闭着眼阿弥陀佛<br />大和尚说挑水我挑的最多<br />嘿嘿 挑的最多<br />咿咿 挑的最多<br />二和尚说新来的应该多干活<br />嘿嘿 应该多干活<br />咿咿 应该多干活<br />小和尚说年龄幼身体太单薄<br />嘿 身体太单薄呀<br />咿 身体太单薄呀<br />白胡子的长老说我年老不口渴<br />嘿嘿 白胡子的长老说我年老不口渴<br />一个和尚挑呀么挑水喝<br />两个和尚抬呀么抬水喝<br />三个和尚没呀么没水喝<br />你说这是为什么呀为什么<br />从此以后呀和尚都不抬水喝<br />不挑水的日子还是一样过<br />谁也不用奇怪也别问为什么呀<br />几千年的奥妙谁也不会说破<br />几千年的奥妙谁也不会说破<br />谁也不会说破','1','','0','','1','/dpic/20120725/11641.jpg','354','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5PYUdKdFpHeE1iazR6V21jOVBRPT0=','0','0','http://s.61baobao.com/common/flash/2006/sange.swf','http://www.61baobao.com/common/flash/2006/dpic/sange.jpg','http://www.61baobao.com/common/flash/2006/pic/354.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6426','14','0','','','','1','admin','','1','0','1343237334','0','0','0','0','','','6426','0','0','0','0','0','0','我的小马车','1343237334','/spic/20120725/11618.jpg','0','1','1343237334','0','3','1','0','','0','','/d/file/swf/xiaomache.swf','667','479','我心爱的小马车呀<br />你就是太顽皮<br />你若是变的乖乖的呀<br />姐儿我就喜欢你<br />的达的的达的…<br />的达的达的…<br />不达目的不休息呀<br />不休息<br />我心爱的小马车呀<br />道路总有崎岖<br />崎岖的山路走过去呀<br />人生那就更美丽<br />的达的的达的…<br />的达的达的…<br />不达目的不休息呀<br />不休息<br />(白)我心爱的小马车<br />驰骋在夕阳里<br />夕阳和我们在一起<br />这一辈子难忘记<br />的达的的达的…<br />的达的达的…<br />不达目的不休息呀<br />不休息<br />不达目的不休息呀<br />不休息','1','','0','','1','/dpic/20120725/11619.jpg','358','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5vY0ZsWE9YUlpWMDV2V2xNMWVtUXlXVDA9','0','0','http://s.61baobao.com/common/flash/2006/xiaomache.swf','http://www.61baobao.com/common/flash/2006/dpic/xiaomache.jpg','http://www.61baobao.com/common/flash/2006/pic/358.jpg','0','三个月以上','0','','0','','0','0','0');");
