E_D("replace into `phome_ecms_game` values('6428','14','0','','','','1','admin','|24|','1','0','1343237335','0','0','0','0','','','6428','0','0','0','0','0','0','吹草哨','1343237335','/spic/20120725/11646.jpg','0','1','1343237335','0','3','1','0','','0','','/d/file/swf/chui.swf','667','479','哔哩哩 哔哩哩，哨音像银铃。<br />多好听云雀惊，展翅飞入云。<br />低头看拖拉机，忙耕耘忙耕耘。<br />春光一刻值千金，莫耽误节令。<br />哔哩哩 哔哩哩 哔哩哩，<br />万紫千红春天又来临。<br />摘草叶口中吹，哨音像银铃。<br /><br />哔哩哩 哔哩哩，哨音像银铃。<br />多好听鲤鱼惊，结队水面行。<br />水库宽 清粼粼，好风景 好风景。<br />天高水阔凭鱼跃，满眼是银鳞。<br />哔哩哩 哔哩哩 哔哩哩，<br />万紫千红春天又来临。<br />摘草叶口中吹，哨音像银铃。<br /><br />哔哩哩 哔哩哩，哨音像银铃。<br />多好听蓓蕾惊，窗旁传花信。<br />金达莱最先开。笑冰凌笑冰凌，<br />春天一到雪融尽，原野花似锦。<br />哔哩哩 哔哩哩哔哩哩，<br />万紫千红春天又来临。<br />','1','','0','','1','/dpic/20120725/11647.jpg','353','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREpPYjJSWGEzVmpNMlJ0','0','0','http://s.61baobao.com/common/flash/2006/chui.swf','http://www.61baobao.com/common/flash/2006/dpic/chui.jpg','http://www.61baobao.com/common/flash/2006/pic/353.jpg','0','三个月以上','0','','0','','0','0','0');");
