E_D("replace into `phome_ecms_game` values('6440','14','0','','','','1','admin','','1','0','1343237339','0','0','0','0','','','6440','0','0','0','0','0','0','幸福拍手歌','1343237339','/spic/20120725/11656.jpg','0','1','1343237339','0','3','1','0','','0','','/d/file/swf/xinfu.swf','667','479','如果感到幸福你就拍拍手（拍手两下）<br /><br />如果感到幸福你就拍拍手（拍手两下）<br /><br />如果感到幸福你就一起拍拍手吧，<br /><br />我们大家都来一起拍拍手（拍手三下）<br /><br /><br />如果感到幸福你就跺跺脚（跺脚两下）<br /><br />如果感到幸福你就跺跺脚（跺脚两下）<br /><br />如果感到幸福你就一起跺跺脚吧，<br /><br />我们大家都来一起跺跺脚（跺脚三下）<br /><br />如果感到幸福你就拍拍肩（拍肩两下）<br /><br />如果感到幸福你就拍拍肩（拍肩两下）<br /><br />如果感到幸福你就一起拍拍肩吧，<br /><br />我们大家都来一起拍拍肩（拍肩三下）','1','','0','','1','/dpic/20120725/11657.jpg','339','VEROd01Fd3pSbkJpYlVwb1luazVOR0ZYTlcxa1V6VjZaREpaUFE9PQ==','0','0','http://s.61baobao.com/zt/qinbao/xinfu.swf','http://www.61baobao.com/common/flash/2006/dpic/xinfu.jpg','http://www.61baobao.com/common/flash/2006/pic/339.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6441','14','0','','','','1','admin','|26|','1','0','1343237339','0','0','0','0','','','6441','0','0','0','0','0','0','何家小鸡何家猜','1343237339','/spic/20120725/11652.jpg','0','1','1343237339','0','3','1','0','','0','','/d/file/swf/hejiaxiaoji.swf','667','479','真怪诞嘛又有趣<br />你望望公园里<br />有四百小鸡咕咕咕<br />何家不知道<br /><br />何家公鸡何家猜<br />何家小鸡何家猜<br />何家公鸡何家猜<br />何家母鸡咕咕咕<br /><br />猴子哥哥熊先生<br />松鼠妹妹牛叔叔<br />黄狗爸爸羊妈妈<br />真奇怪啊真奇怪','1','','0','','1','/dpic/20120725/11653.jpg','331','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREpvYkdGdGJHaGxSMnhvWWpKd2NFeHVUak5hWnowOQ==','0','0','http://s.61baobao.com/common/flash/2006/hejiaxiaoji.swf','http://www.61baobao.com/common/flash/2006/dpic/hejiaxiaoji.jpg','http://www.61baobao.com/common/flash/2006/pic/331.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6442','14','0','','','','1','admin','','1','0','1343237339','0','0','0','0','','','6442','0','0','0','0','0','0','采蘑菇的小姑娘','1343237339','/spic/20120725/11622.jpg','0','1','1343237339','0','3','1','0','','0','','/d/file/swf/caimogu.swf','667','479','采蘑菇的小姑娘<br /><br />背着一个大竹筐<br /><br />清晨光着小脚丫<br /><br />走遍森林和山冈<br /><br />她采的蘑菇最多<br /><br />多得像那星星数不清<br /><br />她采的蘑菇最大<br /><br />大得像那小伞装满筐<br /><br />噻箩箩哩噻箩箩哩噻<br /><br />噻箩箩箩<br /><br />噻箩箩箩哩噻<br /><br />谁不知这山里的蘑菇香<br /><br />她却不肯尝一尝<br /><br />攒到赶集的那一天<br /><br />赶快背到集市上<br /><br />换上一把小镰刀<br /><br />再加上几块棒棒糖<br /><br />和那小伙伴一起<br /><br />把劳动的幸福来分享<br /><br />噻箩箩哩噻箩箩哩噻<br /><br />噻箩箩箩<br /><br />噻箩箩箩哩噻<br /><br />噻箩箩哩噻箩箩哩噻<br /><br />噻箩箩箩<br /><br />噻箩箩箩哩噻<br /><br />噻箩箩哩噻箩箩哩噻<br /><br />噻箩箩箩<br /><br />噻箩箩箩哩噻<br /><br />噻箩箩哩噻箩箩哩噻<br /><br />噻箩箩箩<br /><br />噻箩箩箩哩噻','1','','0','','1','/dpic/20120725/11623.jpg','347','VEROd01Fd3pSbkJpYlVwb1luazVhbGxYYkhSaU1tUXhURzVPTTFwblBUMD0=','0','0','http://s.61baobao.com/zt/qinbao/caimogu.swf','http://www.61baobao.com/zt/qinbao/dpic/caimogu.jpg','http://www.61baobao.com/zt/qinbao/pic/caimogu.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6443','14','0','','','','1','admin','','1','0','1343237340','0','0','0','0','','','6443','0','0','0','0','0','0','十二生肖歌','1343237340','/spic/20120725/11666.jpg','0','1','1343237340','0','3','1','0','','0','','/d/file/swf/12shengxiao.swf','667','479','小老鼠打头来<br />牛把蹄儿抬<br />老虎回头一声吼<br />兔儿跳得快<br />兔儿跳得快<br />龙和蛇尾巴甩<br />马羊步儿迈<br />小猴机灵蹦又跳<br />鸡唱天下白<br />鸡唱天下白<br />狗儿跳，猪儿叫<br />老鼠又跟来<br />十二生肖转圈跑<br />请把顺序排<br />请把顺序排','1','','0','','1','/dpic/20120725/11667.jpg','338','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUSHBGZVdNeWFHeGliV1EwWVZkR2RreHVUak5hWnowOQ==','0','0','http://s.61baobao.com/common/flash/2006/12shengxiao.swf','http://www.61baobao.com/common/flash/2006/dpic/12shengxiao.jpg','http://www.61baobao.com/common/flash/2006/pic/338.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6444','14','0','','','','1','admin','','1','0','1343237340','0','0','0','0','','','6444','0','0','0','0','0','0','早操歌','1343237340','/spic/20120725/11661.jpg','0','1','1343237340','0','3','1','0','','0','','/d/file/swf/zaocaoge.swf','667','479','天上的朝霞好像百花开放<br />树上的小鸟快乐地歌唱<br />早晨的空气多么新鲜<br />早晨的风呀多么清爽<br />我们天天起得早<br />起来就做早操<br /><br />冬天我们不怕大雪和风霜<br />夏天里不怕火热的太阳<br />我们游泳 我们滑冰<br />看我的身体多么健壮<br />我们天天起得早<br />起来就做早操<br />我们的精神总是这样愉快<br />我们的脑筋灵活又聪明<br />每天的功课样样做好<br />新的知识不断增长<br />我们天天起得早<br />起来就做早操','1','','0','','1','/dpic/20120725/11662.jpg','330','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE53YUdJeVRtaGlNbVJzVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2006/zaocaoge.swf','http://www.61baobao.com/common/flash/2006/dpic/zaocaoge.jpg','http://www.61baobao.com/common/flash/2006/pic/330.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6445','14','0','','','','1','admin','','1','0','1343237340','0','0','0','0','','','6445','0','0','0','0','0','0','每当我走过老师窗前','1343237340','/spic/20120725/11630.jpg','0','1','1343237340','0','3','1','0','','0','','/d/file/swf/meidang.swf','667','479','静静的深夜群星在闪耀<br />老师的房间彻夜明亮<br />每当我轻轻走过您窗前<br />明亮的灯光照耀我心房<br />啊，每当想起您，敬爱的老师<br />一阵阵暖流心中激荡<br />培育新一代辛勤的园丁<br />今天深夜啊仍在亮<br />呕心沥血您在写教材<br />高大的身影映在您窗上<br />啊，每当想起您，敬爱的老师<br />一阵阵暖流心中激荡<br />[采蘑菇的小姑娘]<br />晓光词谷建芬曲演唱：田蕙<br />采蘑菇的小姑娘，背着一个大箩筐<br />清早光着小脚丫，走遍树林河山冈<br />她采的蘑菇最多，多得像那星星数不清<br />她采的蘑菇最大，大得像那小伞装满筐<br />赛罗罗罗罗里赛罗哩赛，<br />赛罗罗罗罗罗哩赛罗哩赛<br />赛罗罗哩赛罗罗哩赛罗罗哩赛罗罗哩赛<br />罗罗罗哩赛。<br />谁不知那山里的蘑菇香<br />她却不肯尝一尝<br />盼到赶集的那一天，快快背到集市上<br />换上一把小镰刀，再换上几块棒棒糖<br />和那小伙伴一起，把劳动的幸福来分享<br />','1','','0','','1','/dpic/20120725/11631.jpg','346','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREl4YkdGWFVtaGliV04xWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2006/meidang.swf','http://www.61baobao.com/common/flash/2006/dpic/meidang.jpg','http://www.61baobao.com/common/flash/2006/pic/346.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6446','14','0','','','','1','admin','','1','0','1343237341','0','0','0','0','','','6446','0','0','0','0','0','0','我的皮鞋踏踏响','1343237341','/spic/20120725/11674.jpg','0','1','1343237341','0','3','1','0','','0','','/d/file/swf/wodepixietataxiang.swf','667','479','','1','','0','','1','/dpic/20120725/11675.jpg','337','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5rZGxwSFZuZGhXR2h3V2xoU2FHUkhSalJoVjBaMVduazFlbVF5V1QwPQ==','0','0','http://s.61baobao.com/common/flash/2006/wodepixietataxiang.swf','http://www.61baobao.com/common/flash/2006/dpic/wodepixietataxiang.jpg','http://www.61baobao.com/common/flash/2006/pic/337.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6447','14','1','','','','1','admin','|26|','1','0','1343237341','0','0','0','0','','','6447','0','0','0','0','0','0','让爱住我家','1343237341','/spic/20120725/11670.jpg','0','1','1343237341','0','3','1','0','','0','','/d/file/swf/rangaizhuwojia.swf','667','479','我爱我的家 <br />弟弟爸爸妈妈 <br />爱是不吵架常常陪我玩耍 <br /><br />我爱我的家 <br />儿子女儿我的他 <br />爱就是忍耐家庭所有繁杂 <br /><br />我爱我的家 <br />儿子女儿我亲爱的她 <br />爱就是付出让家不缺乏 <br /><br />让爱天天住你家 <br />让爱天天住我家 <br />不分日夜秋冬春夏 <br />全心全意爱我们的家 <br />让爱天天住你家 <br />让爱天天住我家 <br />充满快乐拥有平安 <br />让爱永远住我们的家 <br /><br />我爱我的家 <br />弟弟爸爸妈妈 <br />爱是不嫉妒弟弟有啥我有啥 <br /><br />我爱我的家 <br />儿子女儿我的他 <br />爱就是感谢不记任何代价 <br /><br />我爱我的家 <br />儿子女儿我亲爱的她 <br />爱就是珍惜时光和年华 <br /><br />让爱天天住你家 <br />让爱天天住我家 <br />不分日夜秋冬春夏 <br />全心全意爱我们的家 <br />让爱天天住你家 <br />让爱天天住我家 <br />充满快乐拥有平安 <br />让爱永远住我们的家 <br />让爱永远住我们的家','1','','0','','1','/dpic/20120725/11672.jpg','329','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5LYUdKdFpHaGhXSEJ2WkZoa2RtRnRiR2hNYms0eldtYzlQUT09','1','0','http://s.61baobao.com/common/flash/2006/rangaizhuwojia.swf','http://www.61baobao.com/common/flash/2006/dpic/rangaizhuwojia.jpg','http://www.61baobao.com/common/flash/2006/pic/329.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6448','14','1','','','','1','admin','|6|','1','0','1343237341','0','0','0','1','','','6448','0','0','0','0','0','0','让我们荡起双浆','1343237341','/spic/20120725/11638.jpg','0','1','1343606159','0','7','2','0','','1','','/d/file/swf/ranwomendangqi.swf','667','479','  让我们荡起双桨，<br />小船儿推开波浪。<br />海面倒映着美丽的白塔，<br />四周环绕着绿树红墙。<br />小船儿轻轻飘荡在水中，<br />迎面吹来了凉爽的风。<br />红领巾迎着太阳，<br />阳光洒在海面上。<br />水中鱼儿望着我们，<br />悄悄地听我们愉快歌唱。<br />小船儿轻轻飘荡在水中，<br />迎面吹来了凉爽的风。<br />做完了一天的功课，<br />我们来尽情欢乐。<br />我问你亲爱的伙伴，<br />谁给我们安排下幸福的生活。<br />小船儿轻轻飘荡在水中，<br />迎面吹来了凉爽的风','1','','0','','1','/dpic/20120725/11639.jpg','345','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5LYUdKdVpIWmlWMVoxV2tkR2RWb3pSbkJNYms0eldtYzlQUT09','1','0','http://s.61baobao.com/common/flash/2006/ranwomendangqi.swf','http://www.61baobao.com/common/flash/2006/dpic/ranwomendangqi.jpg','http://www.61baobao.com/common/flash/2006/pic/345.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6449','14','0','','','','1','admin','|10|24|26|','1','0','1343237342','0','0','0','0','','','6449','0','0','0','0','0','0','吉祥三宝','1343237342','/spic/20120725/11680.jpg','0','1','1343612868','0','3','1','0','','1','','/d/file/swf/jixiangsabao.swf','667','479','词曲/布仁巴雅尔<br /><br />    小女孩问：“爸爸，太阳出来月亮回家了吗？”爸爸回答：“没有。”小女孩问：“星星出来太阳去哪里了？”爸爸回答：“在天上。”小女孩问：“我怎么找也找不到它？”爸爸回答：“回家了。”女儿爸爸合：“太阳月亮星星就是吉祥的一家。”小女孩问：“妈妈，叶子绿了什么时候开花？”妈妈回答：“等叶子落了。”小女孩问：“花儿红了果实能去摘吗？”妈妈回答：“等花儿谢了。”小女孩问：“果实种在土里会发芽吗？”妈妈回答：“等到春天。”爸爸妈妈女儿合：“花儿叶子果实就是吉祥的一家。”爸爸妈妈问女儿：“宝贝，爸爸像太阳照着妈妈。”女儿回答：“那妈妈呢？”爸爸妈妈回答：“妈妈像绿叶托着红花。”女儿回答：“那我呢？”爸爸妈妈回答：“你像种子一样正在发芽。”女儿回答：“明白了。”爸爸妈妈女儿合：“我们三个就是吉祥如意的一家。”　　','1','','0','','1','/dpic/20120725/11681.jpg','336','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREp3Y0dWSGJHaGliV1I2V1ZkS2FHSjVOWHBrTWxrOQ==','0','0','http://s.61baobao.com/common/flash/2006/jixiangsabao.swf','http://www.61baobao.com/common/flash/2006/dpic/jixiangsabao.jpg','http://www.61baobao.com/common/flash/2006/pic/336.jpg','0','三个月以上','0','','0','','0','0','0');");
