E_D("replace into `phome_ecms_game` values('6456','14','0','','','','1','admin','','1','0','1343237344','0','0','0','0','','','6456','0','0','0','0','0','0','月光光','1343237344','/spic/20120725/11688.jpg','0','1','1343237344','0','3','1','0','','0','','/d/file/swf/yueguangguang.swf','667','479','月光光照地塘，虾仔你乖乖训落床<br />听朝阿妈要赶插秧咯，阿爷睇牛去上山岗<br />哦哦哦，哦哦哦<br />虾仔你快高长大咯，帮手阿爷去睇牛羊<br />啊啊啊，啊啊啊<br />月光光照地塘虾仔，你乖乖训落床<br />听朝阿爸要捕鱼虾咯，阿嫲织网要织到天光<br />啊啊啊，啊啊啊<br />虾仔你快高长大咯，蛙艇撒网就更在行<br />月光光,照地堂,年卅晚,摘槟榔.<br />五谷丰收堆满仓,老老嫩嫩喜喜洋洋.<br />啊啊啊，啊啊啊<br />虾仔你快D眯埋眼咯，一觉训到大天光<br />啊啊啊，啊啊啊 ','1','','0','','1','/dpic/20120725/11689.jpg','326','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5zTVZwWFpERlpWelZ1V2pOV2FHSnRZM1ZqTTJSdA==','0','0','http://s.61baobao.com/common/flash/2006/yueguangguang.swf','http://www.61baobao.com/common/flash/2006/dpic/yueguangguang.jpg','http://www.61baobao.com/common/flash/2006/pic/326.jpg','0','三个月以上','0','','0','','0','0','0');");
