E_D("replace into `phome_ecms_game` values('6483','14','0','','','','1','admin','|26|','1','0','1343237352','0','0','0','0','','','6483','0','0','0','0','0','0','在爱里成长','1343237352','/spic/20120725/11754.jpg','0','1','1343237352','0','3','1','0','','0','','/d/file/swf/zaiailichengzhang.swf','667','479','蓝蓝的天，白白的云，<br />绿的叶儿，红的太阳<br />我的天空，我的白云，<br />我的森林，我的太阳,啊啊<br />我伸出双手，放眼四方<br />我伸出双手，放声歌唱<br />我看见，太阳在笑，花在开放<br />我看见，树伸着腰，向上生长<br />我看见天空打开心窗，任鸟飞翔<br />我看见朵朵云儿结伴，飘向远方<br />蓝蓝的天，白白的云，<br />绿的叶儿，红的太阳<br />我的天空，我的白云，<br />我的森林，我的太阳,啊啊<br />太阳太阳，照着大地，发热发光<br />天空天空，高挂在上，宽阔无边<br />爸爸放的风筝，飘在白云上，向我点头笑<br />妈妈坐在树荫下，唱着歌谣，进入我梦乡<br />蓝蓝的天，白白的云，<br />绿的叶儿，红的太阳<br />我的梦想，我的歌声，<br />我的快乐，我的家乡，啊啊<br />我伸出双手，伸向四方<br />我伸出双手，在爱里成长，啊啊','1','','0','','1','/dpic/20120725/11755.jpg','304','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE53YUdGWFJuQmlSMnhxWVVkV2RWb3pjRzlaVnpWdVRHNU9NMXBuUFQwPQ==','0','0','http://s.61baobao.com/common/flash/2006/zaiailichengzhang.swf','http://www.61baobao.com/common/flash/2006/dpic/zaiailichengzhang.jpg','http://www.61baobao.com/common/flash/2006/pic/304.jpg','0','三个月以上','0','','0','','0','0','0');");
