E_D("replace into `phome_ecms_game` values('6485','14','0','','','','1','admin','|26|','1','0','1343237353','0','0','0','0','','','6485','0','0','0','0','0','0','爸爸妈妈听我说','1343237353','/spic/20120725/11756.jpg','0','1','1343237353','0','3','1','0','','0','','/d/file/swf/babamamatingwoshuo.swf','667','479','你对我好，我心里都知道 <br />我学学这个学学那个，<br />忙得不的了 <br />我的烦恼又有谁会知道 <br />我学的太多学的太杂消化不了 <br />你对我好，我心里都知道 <br />我学学这个学学那个，<br />忙得不的了 <br />我的烦恼又有谁能知道，<br />学的太多学的太杂消化不了 <br />爸爸听我说，妈妈听我说，<br />我喜欢和小朋友蹦蹦跳跳 <br />爸爸听我说，妈妈听我说，<br />我也喜欢和你们打打闹闹 <br />你对我好我心里都知道，<br />我学学这个学学那个，<br />忙得不得了 <br />我的烦恼又有谁会知道，<br />学的太多学的太杂消化不了 <br />爸爸听我说，妈妈听我说 <br />我喜欢和小朋友蹦蹦跳跳 <br />爸爸听我说 妈妈听我说 <br />我也喜欢和你们打打闹闹 <br />爸爸听我说，妈妈听我说 <br />我喜欢和小朋友蹦蹦跳跳 <br />爸爸听我说 妈妈听我说 <br />我也喜和你们打打闹闹<br /><br />','1','','0','','1','/dpic/20120725/11757.jpg','296','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREpLYUZsdFJuUlpWekZvWkVkc2RWb3paSFpqTW1neFluazFlbVF5V1QwPQ==','0','0','http://s.61baobao.com/common/flash/2006/babamamatingwoshuo.swf','http://www.61baobao.com/common/flash/2006/dpic/babamamatingwoshuo.jpg','http://www.61baobao.com/common/flash/2006/pic/296.jpg','0','三个月以上','0','','0','','0','0','0');");
