E_D("replace into `phome_ecms_game` values('6542','15','1','','','','1','admin','','1','0','1343237373','0','0','0','0','','','6542','0','0','0','0','0','0','Down by the station','1343237373','/spic/20120725/11906.gif','0','1','1343237373','0','3','1','0','','0','','/d/file/swf/ennsyweensyspider.swf','667','479','','1','','0','','1','/dpic/20120725/11907.gif','510','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREpXZFdKdVRqVmtNbFpzWW01T05XTXpRbkJhUjFaNVRHNU9NMXBuUFQwPQ==','1','0','http://s.61baobao.com/common/flash/2006/ennsyweensyspider.swf','http://www.61baobao.com/common/flash/2006/dpic/ennsyweensyspider.gif','http://www.61baobao.com/common/flash/2006/pic/509.gif','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6550','14','2','','','','1','admin','','1','0','1343237376','0','0','0','0','','','6550','0','0','0','0','0','0','歌唱二小放牛郎','1343237376','/spic/20120725/11970.jpg','0','1','1343237376','0','3','1','0','','0','','/d/file/swf/erxiao.swf','667','479','牛儿还在山坡吃草， <br />放牛的却不知道哪儿去了？ <br />不是他贪玩耍丢了牛， <br />那放牛的孩子王二小。 <br />九月十六那天早上， <br />敌人向一条山沟扫荡， <br />山沟里掩护着后方机关， <br />掩护着几千老乡。 <br />正在那十分危急的时候， <br />敌人快要走到山口， <br />昏头昏脑地迷失了方向， <br />抓住了二小要他带路。 <br />二小他顺从地走在前面， <br />把敌人带进我们的埋伏圈， <br />四下里乒乓乒乓响起了枪炮， <br />敌人才知道受了骗。 <br />敌人把二小挑在枪尖， <br />摔死在大石头的上面， <br />我们那十三岁的二小， <br />可怜他死得这样惨。 <br />干部和老乡得到了安全， <br />他却睡在冰冷的山间， <br />他的脸上含着微笑， <br />他的血染红蓝的天。 <br />秋风吹遍了每个村庄， <br />它把这个动人的故事传扬， <br />每一个村庄都含着眼泪， <br />歌唱着二小放牛郎。<br />','1','','0','','1','/dpic/20120725/11971.jpg','291','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREpXZVdWSGJHaGllVFY2WkRKWlBRPT0=','2','0','http://s.61baobao.com/common/flash/2006/erxiao.swf','http://www.61baobao.com/common/flash/2006/dpic/erxiao.jpg','http://www.61baobao.com/common/flash/2006/pic/291.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6552','14','0','','','','1','admin','|26|','1','0','1343237377','0','0','0','0','','','6552','0','0','0','0','0','0','回家吧','1343237377','/spic/20120725/12012.jpg','0','1','1343237377','0','3','1','0','','0','','/d/file/swf/huijiaba.swf','667','479','鸟儿声声，<br />唧唧又喳喳，<br />问一声：鸟儿，<br />你住在哪儿<br />太阳下山，<br />快快回家<br />不要玩耍，<br />妈妈笑哈哈<br /><br />','1','','0','','1','/dpic/20120725/12013.jpg','285','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREpvTVdGWGNIQlpWMHBvVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2006/huijiaba.swf','http://www.61baobao.com/common/flash/2006/dpic/huijiaba.jpg','http://www.61baobao.com/common/flash/2006/pic/285.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6553','14','0','','','','1','admin','','1','0','1343237377','0','0','0','1','','','6553','0','0','0','0','0','0','法国号','1343237377','/spic/20120725/11976.jpg','0','1','1343237377','0','3','1','0','','0','','/d/file/swf/faguohao.swf','667','479','嘣巴巴，嘣巴巴，谁在唱歌？ <br /><br />嘣巴巴，嘣巴巴，多么欢乐。 <br /><br />嘣巴巴，嘣巴巴，它在唱歌， <br /><br />它就是我最心爱的小伙伴。<br /><br />','1','','0','','1','/dpic/20120725/11977.jpg','290','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREphYUZvelZuWmhSMFoyVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2006/faguohao.swf','http://www.61baobao.com/common/flash/2006/dpic/faguohao.jpg','http://www.61baobao.com/common/flash/2006/pic/290.jpg','0','三个月以上','0','','0','','0','0','0');");
