E_D("replace into `phome_ecms_game` values('6560','14','0','','','','1','admin','','1','0','1343237379','0','0','0','0','','','6560','0','0','0','0','0','0','快乐的小木匠','1343237379','/spic/20120725/11974.jpg','0','1','1343237379','0','3','1','0','','0','','/d/file/swf/kuailemu.swf','667','479','嚓嚓嚓嚓刨花飞，<br />沙沙沙沙大锯响。<br />我是快乐的小木匠，<br />小木匠，嗨！嗨！<br />快乐的小木匠。<br />干起活跳又唱，跳又唱，<br />手艺别提有多棒，有多棒。<br />我是快乐的小木匠，<br />小木匠，嗨！嗨！<br />快乐的小木匠。<br />木板堆成一排排，一排排，<br />木条排成一行行，一行行。<br />我是快乐的小木匠，<br />小木匠，嗨！嗨！<br />人人都夸奖。<br />','1','','0','','1','/dpic/20120725/11975.jpg','282','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREowTVZsWGJITmFWekV4VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2006/kuailemu.swf','http://www.61baobao.com/common/flash/2006/dpic/kuailemu.jpg','http://www.61baobao.com/common/flash/2006/pic/282.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6565','14','3','','','','1','admin','','1','0','1343237381','0','0','0','0','','','6565','0','0','0','0','0','0','公共汽车_儿童交通儿歌','1343237381','/spic/20120725/11984.jpg','0','1','1343237381','0','8','2','0','','0','','/d/file/swf/gonggongqiche.swf','667','479','公共汽车飞快跑，<br /><br />扶手一定抓紧了，<br /><br />不要上窜和下跳，<br /><br />更不伸手窗外闹，<br /><br />备好零钱去买票，<br /><br />积极让座要敬老。<br /><br /> <br /><br />公共汽车飞快跑，<br /><br />扶手一定抓紧了，<br /><br />不要上窜和下跳，<br /><br />更不伸手窗外闹，<br /><br />不吃零食不吵闹，<br /><br />文明乘车要记牢。<br />','1','','0','','1','/dpic/20120725/11985.jpg','288','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREprZG1KdFpHNWlNalZ1WTFkc2FtRkhWWFZqTTJSdA==','3','0','http://s.61baobao.com/common/flash/2006/gonggongqiche.swf','http://www.61baobao.com/common/flash/2006/dpic/gonggongqiche.jpg','http://www.61baobao.com/common/flash/2006/pic/288.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6566','14','0','','','','1','admin','','1','0','1343237381','0','0','0','0','','','6566','0','0','0','0','0','0','大树桩你有几岁','1343237381','/spic/20120725/11954.jpg','0','1','1343237381','0','3','1','0','','0','','/d/file/swf/dashuzhuang.swf','667','479','小河边有一颗大树桩，<br />树桩上一圈圈真漂亮。<br />哎哟哟哟，大树桩罗，你有几岁。<br />哎哟哟哟，谁知道罗，谁来讲罗。<br />数一数树桩上圆圈有多少，<br />几十圈，几十圈，不多也不少。<br />啊哈哈哈，大树桩罗，你有几十岁。<br />啊哈哈哈，你比爷爷年纪还要大罗。 <br />啊哈哈哈，你比爷爷年纪还要大罗。','1','','0','','1','/dpic/20120725/11955.jpg','293','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREpTYUdNeWFERmxiV2d4V1ZjMWJreHVUak5hWnowOQ==','0','0','http://s.61baobao.com/common/flash/2006/dashuzhuang.swf','http://www.61baobao.com/common/flash/2006/dpic/dashuzhuang.jpg','http://www.61baobao.com/common/flash/2006/pic/293.jpg','0','三个月以上','0','','0','','0','0','0');");
