E_D("replace into `phome_ecms_game` values('6572','14','0','','','','1','admin','','1','0','1343237383','0','0','0','0','','','6572','0','0','0','0','0','0','快乐小朋友','1343237383','/spic/20120725/11998.jpg','0','1','1343237383','0','3','1','0','','0','','/d/file/swf/kuailex.swf','667','479','快乐小朋友天天多开心,<br />快乐巧连智天天陪着我,<br />弟弟妹妹开动脑筋,<br />巧手创出新天地.<br />啦…………啦…………<br />啦………………<br />快乐巧连智我们的好朋友<br />多开心好孩子<br />健康又聪明<br /><br />','1','','0','','1','/dpic/20120725/11999.jpg','281','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREowTVZsWGJITmFXR2QxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2006/kuailex.swf','http://www.61baobao.com/common/flash/2006/dpic/kuailex.jpg','http://www.61baobao.com/common/flash/2006/pic/281.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6576','14','0','','','','1','admin','','1','0','1343237384','0','0','0','0','','','6576','0','0','0','0','0','0','贺新年','1343237384','/spic/20120725/12006.jpg','0','1','1343237384','0','3','1','0','','0','','/d/file/swf/hexinnian.swf','667','479','贺新年祝新年，新年呀年年年，<br />爆竹声声催的响又远，<br />贺新年祝新年，新年呀年年年，<br />岁月悠悠光阴如箭，<br />回看往事如烟痛苦辛酸，<br />希望从今年万事如愿，<br />贺新年祝新年，新年呀年年年，<br />愿大家都过个太平年。<br /><br />','1','','0','','1','/dpic/20120725/12007.jpg','287','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREpvYkdWSGJIVmliV3hvWW1rMWVtUXlXVDA9','0','0','http://s.61baobao.com/common/flash/2006/hexinnian.swf','http://www.61baobao.com/common/flash/2006/dpic/hexinnian.jpg','http://www.61baobao.com/common/flash/2006/pic/287.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6582','14','1','','','','1','admin','|24|','1','0','1343237387','0','0','0','0','','','6582','0','0','0','0','0','0','同一首歌','1343237387','/spic/20120725/12036.jpg','0','1','1343237387','0','3','1','0','','0','','/d/file/swf/tongyishouge.swf','667','479','鲜花曾告诉我你怎样走过<br />大地知道你心中的每一个角落<br />甜蜜的梦啊谁都不会错过<br />终于迎来今天的这欢聚时刻<br />水千条山万座我们曾走过<br />每一次相逢和笑脸都彼此铭刻<br />在阳光灿烂欢乐的日子里<br />我们手拉手想说的太多<br />星光撒满了所有的童年<br />风雨走遍了世间的角落<br />同样的感受给了我们同样的渴望<br />同样的欢乐给了我们同一首歌<br />阳光下渗透所有的语言<br />春天把友好的故事传说<br />同样的感受给了我们同样的渴望<br />同样的欢乐给了我们同一首歌<br /><br />','1','','0','','1','/dpic/20120725/12037.jpg','275','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5TZG1KdFpEVmhXRTV2WWpOV2JscFROWHBrTWxrOQ==','1','0','http://s.61baobao.com/common/flash/2006/tongyishouge.swf','http://www.61baobao.com/common/flash/2006/dpic/tongyishouge.jpg','http://www.61baobao.com/common/flash/2006/pic/275.jpg','0','三个月以上','0','','0','','0','0','0');");
