E_D("replace into `phome_ecms_game` values('6585','14','1','','','','1','admin','','1','0','1343237388','0','0','0','0','','','6585','0','0','0','0','0','0','乌兰巴托的爸爸','1343237388','/spic/20120725/12026.jpg','0','1','1343237388','0','3','1','0','','0','','/d/file/swf/wulanbatuo.swf','667','479','想你啊乌兰巴托的爸爸<br />想念你就唱你教的歌谣<br />爸爸的心像是辽阔草原<br />我是羊群像白云<br /><br />女儿在遥远的家乡<br />想念你就拉起这马头琴<br />原那琴声随着风儿飘远<br />希望你能听得见<br /><br />','1','','0','','1','/dpic/20120725/12027.jpg','274','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5rTVdKSFJuVlpiVVl3WkZjNGRXTXpaRzA9','1','0','http://s.61baobao.com/common/flash/2006/wulanbatuo.swf','http://www.61baobao.com/common/flash/2006/dpic/wulanbatuo.jpg','http://www.61baobao.com/common/flash/2006/pic/274.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6588','14','1','','','','1','admin','','1','0','1343237389','0','0','0','0','','','6588','0','0','0','0','0','0','谁更快','1343237389','/spic/20120725/11996.jpg','0','1','1343237389','0','3','1','0','','0','','/d/file/swf/shuigengkuai.swf','667','479','小青蛙和兔子赛跑,<br /><br />跳啊跳啊一二一,<br /><br />看看谁啊谁更快啊,<br /><br />跳啊跳啊一二一。<br /><br />小乌龟和蜗牛赛跑,<br /><br />走啊走啊一二一,<br /><br />看看谁啊谁更快啊,<br /><br />走啊走啊一二一。<br /><br />','1','','0','','1','/dpic/20120725/11997.jpg','278','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5PYjJSWGJHNWFWelZ1WVROV2FHRlROWHBrTWxrOQ==','1','0','http://s.61baobao.com/common/flash/2006/shuigengkuai.swf','http://www.61baobao.com/common/flash/2006/dpic/shuigengkuai.jpg','http://www.61baobao.com/common/flash/2006/pic/278.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6593','14','2','','','','1','admin','','1','0','1343237390','0','0','0','1','','','6593','0','0','0','0','0','0','猪都笑了（儿童版）','1343237390','/spic/20120725/12040.jpg','0','1','1343237390','0','3','1','0','','0','','/d/file/swf/zhudouxiaole.swf','667','479','小青蛙说它嘴巴大， 河马叔叔就笑了；<br />河马叔叔说它个子大， 大象爷爷就笑了；<br />大象爷爷说它啥都不怕， 老鼠弟弟就笑了；（咬你耳朵）<br />老鼠说它爱大米， 母鸡阿姨就笑了。（咯咯咯咯）<br /><br /><br />母鸡阿姨说它会唱歌， 鹦鹉哥哥就笑了；<br />鹦鹉哥哥说它眼睛大， 小燕子姐姐就笑了；(我是还珠格格)<br />小燕子说它最可爱， 小狗狗就笑了；<br />小狗狗说它最聪明， 大猩猩就笑了。<br /><br />啦。。。。。。。。 米奇老鼠唐老鸭，<br />大猩猩说它是人模样， 胖呼呼的猪都笑了。<br /><br /><br />天鹅姑姑说它最美丽， 孔雀姐姐就笑了；<br />孔雀姐姐说它很骄傲， 小白兔就笑了；<br />小白兔说它跑得快， 老乌龟就笑了（龟兔赛跑）<br />老乌龟说它是国宝啊， 大熊猫就笑了。<br /><br />啦。。。。。。。。 团团又圆圆，<br />大熊猫说它去台湾啊， 全国人民都笑了。<br /><br />','1','','0','','1','/dpic/20120725/12041.jpg','268','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE53YjJSWFVuWmtXR2h3V1ZjNWMxcFROWHBrTWxrOQ==','2','0','http://s.61baobao.com/common/flash/2006/zhudouxiaole.swf','http://www.61baobao.com/common/flash/2006/dpic/zhudouxiaole.jpg','http://www.61baobao.com/common/flash/2006/pic/268.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6595','14','1','','','','1','admin','','1','0','1343237391','0','0','0','1','','','6595','0','0','0','0','0','0','想你的365天','1343237391','/spic/20120725/12044.jpg','0','1','1343237391','0','3','1','0','','0','','/d/file/swf/xiangni365.swf','667','479','春风扬起你我的离别<br />夏雨打湿孤单的屋檐<br />秋叶飘落思念的红叶<br />冬雪转眼又是一年<br />在想你的三百六十五天<br />听你我最爱的那首歌<br />泪总是一不小心翻涌微笑的脸<br />突然我感觉你没走远<br />怀里有你紧拥的温度<br />眼里有你微笑和痛哭<br />心里有你说过的故事<br />梦里你在回家的路<br />在想你的三百六十五天<br />读你写来的每句安慰<br />爱圈住你我在同一个圆<br />你的冷热我能感觉<br />在想你的三百六十五天<br />海我多想能看得更远<br />爱两颗心间不断的长线<br />我的喜悲都让你包围<br /><br />','1','','0','','1','/dpic/20120725/12045.jpg','273','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5vY0ZsWE5XNWliV3Q2VG1wVmRXTXpaRzA9','1','0','http://s.61baobao.com/common/flash/2006/xiangni365.swf','http://www.61baobao.com/common/flash/2006/dpic/xiangni365.jpg','http://www.61baobao.com/common/flash/2006/pic/273.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6597','14','2','','','','1','admin','','1','0','1343237391','0','0','0','0','','','6597','0','0','0','0','0','0','童年游想','1343237391','/spic/20120725/12014.gif','0','1','1343237391','0','3','1','0','','0','','/d/file/swf/tongnianyou.swf','667','479','Arayofhopeflickersinthesky/Atinystarlightsupwayuphigh/Allacrossthelanddawnsabrandnewmorn,/Thiscomestopasswhenachildisborn.<br /><br />Asilentwishsailsthesevenseas/Thewindsofchangewhisperinthetrees/Andthewallsofdoubtcrumbletossedandtorn,/Thiscomestopasswhenachildisborn.<br /><br />Arosydawnsettlesallaround/Yougottofeelyou\\\\''reonsolidground/Foraspellortwonooneseemsforlorn/Thiscomestopasswhenachildisborn.<br /><br />It\\\\''salladream,anillusionnow./Itmustcometruesometimesoonsomehow/Allacrossthelanddawnsabrandnewmorn/Thiscomestopasswhenachildisborn.<br /><br />《童年游想》中文歌词大意：<br /><br />一道希望之光，在空中闪耀/一颗微星照亮了天上的路/横跨整个大地，展开了一个崭新的黎明/这都是因为一个小孩的诞生<br /><br />无声的愿望航过大海/转向的风在树梢呢喃/猜忌之墙崩塌倾圮/这全是因为一个小孩的诞生<br /><br />到处都充满了红光/你感觉到了，你站在坚硬的土地上/在这段期间，似乎没有人孤单/这全是因为一个小孩的诞生<br /><br />那是一个梦想，一个幻象/未来很快就会实现/横跨整个大地，展开了一个崭新的黎明/全是因为一个小孩的诞生<br /><br />','1','','0','','1','/dpic/20120725/12015.gif','276','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5TZG1KdFpIVmhWMFoxWlZjNU1VeHVUak5hWnowOQ==','2','0','http://s.61baobao.com/common/flash/2006/tongnianyou.swf','http://www.61baobao.com/common/flash/2006/dpic/tongnianyou.gif','http://www.61baobao.com/common/flash/2006/pic/276.gif','0','三个月以上','0','','0','','0','0','0');");
