E_D("replace into `phome_ecms_game` values('6622','14','0','','','','1','admin','','1','0','1343237400','0','0','0','0','','','6622','0','0','0','0','0','0','大家来劳动','1343237400','/spic/20120725/12062.jpg','0','1','1343237400','0','3','1','0','','0','','/d/file/swf/dajialai.swf','667','479','嘿呦加把劲呦，<br />嘿呦加把劲呦，<br />嘿呦里格嘿呦吼吼~~<br />我们大家来劳动呦，<br />嘿呦里格嘿呦吼吼<br /><br />','1','','0','','1','/dpic/20120725/12063.jpg','262','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREpTYUdGdGJHaGlSMFp3VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2006/dajialai.swf','http://www.61baobao.com/common/flash/2006/dpic/dajialai.jpg','http://www.61baobao.com/common/flash/2006/pic/262.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6626','14','2','','','','1','admin','','1','0','1343237401','0','0','0','0','','','6626','0','0','0','0','0','0','DA DA DA','1343237401','/spic/20120725/12068.jpg','0','1','1343237401','0','3','1','0','','0','','/d/file/swf/dadada.swf','667','479','转弯小巷搜寻好结果<br />向前向后转身再向左<br />脱掉烦恼谁的份最多<br />DaDaDaDoDoDoLuLuLuDaDaDa<br />DaDaDa换上快乐舞步DaDaDa<br />HeyHeyHeyHey有话要直说<br />别让机会又擦肩而走<br />遇见Honey勇敢Say～Hello<br />心心相应电流在穿梭哦<br />DaDaDaDoDoDoLuLuLuDaDaDa<br />DaDaDa换上快乐舞步DaDaDa<br />YoYoYoYo为自己加油<br />伤心放假幸福等等我<br />恋爱节奏要天长地久<br />OneTwoThreeFour脚步别落后哦<br />DaDaDaDoDoDoLuLuLuDaDaDa<br />DaDaDa换上快乐舞步DaDaDa<br />HeyHeyHeyHey和未来交手<br />抛开忧愁世界照亮我哦<br />ABCD答案是什么<br />跟着感觉不用又想太多<br />DaDaDaDoDoDoLuLuLuDaDaDa<br />DaDaDa换上快乐舞步DaDaDa<br /><br />YoYoYoYo让开心先过<br />转弯小巷搜寻好结果<br />向前向后转身再向左<br />脱掉烦恼谁的份最多<br />DaDaDaDoDoDoLuLuLuDaDaDa<br />DaDaDa换上快乐舞步DaDaDa<br />HeyHeyHeyHey和未来交手<br />抛开忧愁世界照亮我哦<br />ABCD答案是什么<br />跟着感觉不用又想太多<br />DaDaDaDoDoDoLuLuLuDaDaDa<br />DaDaDa换上快乐舞步DaDaDa<br />DaDaDaDoDoDoLuLuLuDaDaDa<br />DaDaDa换上快乐舞步DaDaDa<br />DaDaDaDoDoDoLuLuLuDaDaDa<br />DaDaDa换上快乐舞步DaDaDa<br />DaDaDaDoDoDoLuLuLuDaDaDa<br />DaDaDa换上快乐舞步DaDaDa<br /><br />','1','','0','','1','/dpic/20120725/12069.jpg','263','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREpTYUZwSFJtdFpVelY2WkRKWlBRPT0=','2','0','http://s.61baobao.com/common/flash/2006/dadada.swf','http://www.61baobao.com/common/flash/2006/dpic/dadada.jpg','http://www.61baobao.com/common/flash/2006/pic/263.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6634','14','2','','','','1','admin','','1','0','1343237404','0','0','0','1','','','6634','0','0','0','0','0','0','狗狗未来不是梦（搞笑版）','1343237404','/spic/20120725/12086.jpg','0','1','1343237404','0','3','1','0','','0','','/d/file/swf/gougou.swf','667','479','鸡年过去了狗年要来到，我们都想要去放鞭炮，<br />向天空叫叫把尾巴摇摇，狗狗本命年马上要来到。 <br /><br />享受着阳光， 紫外线穿破臭氧会把皮肤晒伤。<br />呼吸新鲜空气， 可吸入颗粒物超标最好别出去。<br />我要吃外卖， 一次性餐盒多数都不合格。<br />那我吃快餐， 当心苏丹红像可怕的毛毛虫。<br /><br /><br />那你说我们到底吃什么，总不能在家里干等着挨饿。<br />打开冰箱看一看是劣质的奶粉，还有包裹细菌可怕的保鲜膜。<br />听说就连牙膏还有不沾锅，都可能给我们带来恐怖病魔。<br />电脑、手机、微波炉到处都是辐射，<br />你说、你说，这日子怎么过？<br /><br />狗狗未来不是梦，要放心的过每一分钟，<br />不用担心毛毛虫，也不会为了吃而感到头疼。<br />狗狗未来不是梦，要健康的过每一分钟，<br />只要坚持做运动，一定会强壮得像头狗熊，壮得像头狗熊。<br /><br />我想吃棒棒糖，吃多了影响健康而且还会发胖。<br />我想喝红高粱，喝高了容易误事还会损害肝脏。<br />可是工作压力大，要学会自我解压体力不能透支花。<br />总是心情不好，笑一笑十年少没有什么大不了。<br /><br />你没听人家说过心理健康很重要吗？<br />做男人最重要的就是心胸宽大。<br />任何事都以一颗平常心去对待它，<br />本命年咱的事业一定会有大变化。<br />你看看05年勇敢的小鸡、小鸭，<br />乐观的面对生活，精神多么伟大，<br />接下来2006就得看咱的啦！<br />可不能丢人啊，站直了别趴下！<br /><br />狗狗未来不是梦，要勇敢的过每一分钟，<br />忘掉所有的苦痛，摇摇尾巴去争取成功。<br />狗狗未来不是梦，要坚强的过每一分钟，<br />虽然不是优良品种，也要努力成为狗中英雄，成为狗中英雄','1','','0','','1','/dpic/20120725/12087.jpg','260','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREprZG1SWFpIWmtVelY2WkRKWlBRPT0=','2','0','http://s.61baobao.com/common/flash/2006/gougou.swf','http://www.61baobao.com/common/flash/2006/dpic/gougou.jpg','http://www.61baobao.com/common/flash/2006/pic/260.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6646','14','3','','','','1','admin','|26|','1','0','1343237409','0','0','0','1','','','6646','0','0','0','0','0','0','小兔子乖乖','1343237409','/spic/20120725/12110.jpg','0','1','1343237409','0','3','1','0','','0','','/d/file/swf/xiaotu1.swf','667','479','小兔子乖乖，<br /><br />把门儿开开，<br /><br />快点开开，<br /><br />妈妈要进来。<br /><br />不开，不开，我不开，<br /><br />妈妈没回来，<br /><br />谁来也不开。<br />','1','','0','','1','/dpic/20120725/12111.jpg','248','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5vY0ZsWE9UQmtWRVYxWXpOa2JRPT0=','3','0','http://s.61baobao.com/common/flash/2006/xiaotu1.swf','http://www.61baobao.com/common/flash/2006/dpic/xiaotu1.jpg','http://www.61baobao.com/common/flash/2006/pic/248.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('6659','15','0','','','','1','admin','','1','0','1343237413','0','0','0','0','','','6659','0','0','0','0','0','0','She ll Be Comin Round the Mountain','1343237413','/spic/20120725/12172.gif','0','1','1343237413','0','3','1','0','','0','','/d/file/swf/shellbecominroundthemountain.swf','667','479','','1','','0','','1','/dpic/20120725/12173.gif','430','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5PYjFwWGVITlpiVlpxWWpJeGNHSnVTblprVnpWclpFZG9iR0pYT1RGaWJsSm9ZVmMwZFdNelpHMD0=','0','0','http://s.61baobao.com/common/flash/2006/shellbecominroundthemountain.swf','http://www.61baobao.com/common/flash/2006/dpic/shellbecominroundthemountain.gif','http://www.61baobao.com/common/flash/2006/pic/430.gif','0','三个月以上','0','','0','','0','0','0');");
